var input = @"";

//input = "mjqjpqmgbljsphdztnvjfqwrcgsmlb";

var queue = new Queue<char>();
var marker = 0;
foreach (var c in input)
{
    marker++;
    queue.Enqueue(c);
    if (queue.Count > 14)
    {
        queue.Dequeue();
    }
    if(queue.Distinct().Count() == 14)
    {
        break;
    }
}

Console.WriteLine(marker);